INSERT INTO `exam_components` VALUES (1,'Head to Toe Pan','v','htt','Please position the device 5 feet in front of patient. Press the record button to begin recording for 5 seconds, and sweep camera from head to toe.'),(2,'Mucous Membrane','v','mm','Please position device 3 inches from patient\'s mouth. Ask patient to open mouth wide, and press record button to begin recording for 5 seconds.'),(3,'Auscultate Aortic Site','a','aas','Please position the stethoscope in the aortic cardiac position at the right upper sternal border, and then press the record button to begin recording for 8 seconds.'),(4,'Auscultate Pulmonic Site','a','aps','Please position the stethoscope in the pulmonic cardiac position at the left upper sternal border, and then press the record button to begin recording for 8 seconds.'),(5,'Auscultate Tricuspid Site','a','ats','Please position the stethoscope in the tricuspid cardiac position at the left lower sternal border, and then press the record button to begin recording for 8 seconds.'),(6,'Auscultate Mitral Site','a','ams','Please position the stethoscope in the mitral cardiac position at the apex of the heart, and then press the record button to begin recording for 8 seconds.'),(7,'Auscultate Left Abdomen','a','ala','Please position the stethoscope at the left abdomen, and then press the record button to begin recording for 10 seconds.'),(8,'Auscultate Right Abdomen','a','ara','Please position the stethoscope at the right abdomen, and then press the record button to begin recording for 10 seconds.'),(9,'Auscultate Left Middle','a','alm','Please position the stethoscope at the left middle pulmonary position. Ask the patient to take deep breaths in and out through their mouth, and then press the record button to begin recording for 8 seconds.'),(10,'Auscultate Right Middle','a','arm','Please position the stethoscope at the right middle pulmonary position. Ask the patient to take deep breaths in and out through their mouth, and then press the record button to begin recording for 8 seconds.'),(11,'Auscultate Left Lower','a','all','Please position the stethoscope at the left base pulmonary position. Ask the patient to take deep breaths in and out through their mouth, and then press the record button to begin recording for 8 seconds.'),(12,'Auscultate Right Lower','a','arl','Please position the stethoscope at the right base pulmonary position. Ask the patient to take deep breaths in and out through their mouth, and then press the record button to begin recording for 8 seconds.'),(13,'Right Jugular Venous: Anterior','v','rjva','Please position the device vertically at the right midclavicluar line facing the right internal jugular and press the record button to begin recording for 5 seconds.'),(14,'Right Jugular Venous: Lateral','v','rjvl','Please position the device horizontally at the right lateral shoulder facing the right internal jugular and press the record button to begin recording for 5 seconds.'),(15,'Left Jugular Venous: Anterior','v','ljva','Please position the device vertically at the left midclavicular line facing the right internal jugular and press the record button to begin recording for 5 seconds.'),(16,'Left Jugular Venous: Lateral','v','ljvl','Please position the device horizontally at the left lateral shoulder facing the right internal jugular and press the record button to begin recording for 5 seconds.'),(17,'Auscultate Left Apex','a','lhr','Please position the stethoscope at the left apex pulmonary position. Ask the patient to take deep breaths in and out through their mouth, and then press the record button to begin recording for 8 seconds.'),(18,'Auscultate Right Apex','a','rhr','Please position the stethoscope at the right apex pulmonary position. Ask the patient to take deep breaths in and out through their mouth, and then press the record button to begin recording for 8 seconds.'),(19,'Right Lower Extremity Edema: Knee','v','rleek','Please position the device vertically at the right patella facing the right shin. Press the record button to begin recording for 5 seconds, and apply moderate pressure with index finger to the mid pretibial area.'),(20,'Right Lower Extremity Edema: Anterior','v','rleea','Please position the device 3 feet anterior to the right shin. Press the record button to begin recording for 5 seconds, and apply moderate pressure with index finger to the mid pretibial area.'),(21,'Left Lower Extremity Edema: Knee','v','lleek','Please position the device vertically at the left patella facing the left shin. Press the record button to begin recording for 5 seconds, and apply moderate pressure with index finger to the mid pretibial area.'),(22,'Left Lower Extremity Edema: Anterior','v','lleea','Please position the device 3 feet anterior to the left shin. Press the record button to begin recording for 5 seconds, and apply moderate pressure with index finder to the mid pretibial area.'),(23,'Miscellaneous Video 1','v','mv1',''),(24,'Miscellaneous Video 2','v','mv2','');
